import React from 'react';

function Field(props) {
  switch (props.fieldName) {
    case 'username':
      return (
        <div class="field">
          <label htmlFor={props.fieldName}>Username * </label>
          <input
            type="text"
            id={props.fieldName}
            onChange={props.onChange}
          ></input>
          {addWhitespace()}
        </div>
      );
    case 'nickname':
      return (
        <div class="field">
          <label htmlFor={props.fieldName}>Nickname * </label>
          <input type="text" name="nickname" onChange={props.onChange}></input>
          {addWhitespace()}
        </div>
      );
    case 'password':
      return (
        <div class="field">
          <label id="password" htmlFor="password">
            Password *{' '}
          </label>
          <input
            id="password"
            type="number"
            name="numAcc"
            onChange={props.onChange}
          ></input>
          {addWhitespace()}
        </div>
      );
  }

  function addWhitespace() {
    return (
      <div>
        <br></br>
      </div>
    );
  }
}
export default Field;
